import React from 'react';

const Card = (props) => {
  return (
    <div className="bg-light-green dib br3 pa3 ma2 grow ba bw2 shadow-5">
      <img src='https://robohash.org/{props.id}?size=200x200' alt="robots"/>
      <div>
        <h2>props.name</h2>
        <p>props.email</p>
      </div>
    </div>
  );
}

export default Card;
